import './App.css';
import React, {Component} from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [{
          name: 'Frankenstein',
          id: 'asc1'
        },

        {
          name: 'Dracula',
          id: 'asr2'
        },

        {
          name: 'Zombie',
          id: 'as1w'
        }]
    };
  }

  render() {
    return (

      <div className = 'App'> {
          this.state.monsters.map(monster => <h1> { monster.name } </h1>)
        } 
      </div>
    );
  }
}

  export default App;
